import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
// import './styles/global.css';  // COMMENTED OUT

console.log('1. INDEX.JS STARTED');
console.log('2. App component imported:', App);

const rootElement = document.getElementById('root');
console.log('3. Root element found:', rootElement);

if (rootElement) {
  const root = ReactDOM.createRoot(rootElement);
  console.log('4. Root created');

  root.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>
  );

  console.log('5. Render called');
} else {
  console.error('ROOT ELEMENT NOT FOUND!');
}
